export const setUser = (user, token) => {
    return {
        type: 'SET_USER',
        user,
        token
    }
}

export const destroyToken = () => {
    return {
        type: 'DESTROY_TOKEN',
    }
}

export const deletePost = (id) => {
    return {
        type: 'DELETE_POST',
        id
    }
}
